import './App.css';
import {connect} from "react-redux";
import * as actionTypes from "./redux/actions";
import {useEffect} from "react";

const App = ( props ) => {



  console.log("props:", props);

  useEffect(()=>{
    props.onNameChange("Paco");
    props.onAddMinutes(120);
  },[])


  return( 
      <div>
          <p>{props.myName}</p>
      </div>
  );

} //End of App.

const mapStateToProps = state =>{
  return{
    myName: state.name,
    date: state.date
  };
}

const mapDispatchToProps = dispatch =>{
  return{
    onNameChange: (nameChange) => dispatch({type: actionTypes.CHANGE_NAME, newName:nameChange}),
    onAddMinutes: (minutes) => dispatch({type: actionTypes.ADD_MINUTES, minutesToAdd:minutes}),
  }
}

export default connect(mapStateToProps,mapDispatchToProps)(App);
